('1741','18','7539','Villa Tiesmeier Genova',Null,'Großzügige moderne Luxusvilla mit fantastischen Meer- und Palma-Blick in Genova','20876','Diese exklusive Neubau-Villa  befindet sich in bevorzugter Nachbarschaft unweit \r\nvon Palma und dem Stadtzentrum in einer einzigartigen Lage. Die elegante Luxusvilla mit über 500 m² Wohnfläche besticht durch beste Bau- und Ausstattungsqualität und beeindruckt nicht nur durch sein hochwertiges Interieur sondern präsentiert sich auch in einmaliger Hanglage mit Traumblick auf das Meer und der ganzen Stadt von Palma de Mallorca. Neben einem offenen Wohn - Essbereich auf der Eingangsebene verfügt die Licht durchflutete Villa über 4 weitere Schlafzimmer und Bäder mit direktem Terrassenzugang im Obergeschoss und Untergeschoss. Der Lift fährt von der Tiefgarage bis zur oberen Ebene. Des Weiteren stehen diverse Terrassen, ein Schwimmbad und eine Garage für vier Fahrzeuge zur Verfügung. Weitere Ausstattungsmerkmale sind: Kamin, Fußbodenheizung, Designerküche, Klimaanlage, Marmorböden und Luxusbädern die höchsten Ansprüchen genügen.','20877','3700000','111','2012-02-15 11:06:36','106','2012-02-15 11:07:34',Null,'1305','95','175',1,'1','0',Null,Null,Null,'20878',Null,'0','0','0',Null,'2015-06-11 13:51:46',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'20879',Null,'20880',Null,'20881',Null,'20882',Null,'20883','0',0,'4');
